Suppose we have the following block of code: void add(int x, int y) {
x = x + y;
} int main(){
int a = 10;
int b = 30;
add(a, b);
std::cout << a << '\n';
} You'd expect the output to be 40 right? Wrong! But why though? Enter scoping. When we write add(a, b), what the compiler internally does is that it creates a copy of the variables a and b for the use within the function add. Now the scope of the new variables, now referred to as the copies of the original variables is the function block, i.e., the copies exist only temporarily till the function block is being executed. Once the function block is over, the copies are discarded. Hence the value of 40 that was asssigned to the copy of a vanishes, and a itself retains the value it had. This is the scope of a function. There can be self-made scopes too. int main(){
int a = 30;
// uncommenting the below line will be an error. A variable with one name will be declared twice in the same scope
